import "./Sidebar.css";
import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import Home from "../../assets/icons/home-outline.svg";
import Contacts from "../../assets/icons/contacts.svg";
import Properties from "../../assets/icons/properties.svg";
import Buyers from "../../assets/icons/buyers.svg";
import Sidearrow from "../../assets/svgs/rightarrow.svg";
import doctorlogo from "../../assets/images/doctorlogo.png";
import LeftArrow from "../../assets/svgs/left-arrow.svg";
import RightArrow from "../../assets/svgs/right-arrow.svg";
import { useSelector } from "react-redux";
import { setDate } from "../../redux/Reducer/AuthReducer";

const sidebarOptions = [
  { name: "Dashboard", icon: Home, route: "/dashboard" },
  { name: "Appointment", icon: Properties, route: "/appointment" },
  {
    name: "Doctors",
    icon: Contacts,
    hasSubmenu: true,
    submenu: [
      { name: "Doctor List", route: "/doctor" },
      { name: "Invite Doctor", route: "/doctors/invite-doctor" },
    ],
  },
  {
    name: "Patients",
    icon: Buyers,
    hasSubmenu: true,
    submenu: [
      { name: "All Patients", route: "/allpatients" },
      { name: "Add Patients", route: "/addpatients" },
      { name: "Profile", route: "/patientprofile" },
    ],
  },
  {
    name: "Staff",
    icon: Contacts,
    hasSubmenu: true,
    submenu: [
      { name: "All Staffs", route: "/allstaffs" },
      { name: "Add Staff", route: "/staffs/add-staff" },
    ],
  },
];

const SidebarComponent = () => {
  const [isSidebarCollapsed, setIsSidebarCollapsed] = useState(false);
  const [expandedMenu, setExpandedMenu] = useState(null);
  const location = useLocation();
  const navigate = useNavigate();
  const userType = useSelector((state) => state.setUserType);

  const toggleSidebar = () => {
    setIsSidebarCollapsed(!isSidebarCollapsed);
  };

  const toggleSubmenu = (index) => {
    setExpandedMenu(expandedMenu === index ? null : index);
  };

  useEffect(() => {
    sidebarOptions.forEach((option, index) => {
      if (option.hasSubmenu) {
        const isSubmenuActive = option.submenu.some(
          (subOption) => location.pathname === subOption.route
        );
        if (isSubmenuActive) {
          setExpandedMenu(index);
        }
      }
    });
  }, [location.pathname]);

  const filteredSidebarOptions =
    userType === 1
      ? sidebarOptions
      : sidebarOptions.filter((option) =>
          ["Dashboard", "Appointment", "Staff"].includes(option.name)
        );

  const handleNavigation = (route) => {
    if (route) {
      navigate(route);
    }
  };

  return (
    <div className={`sidebar ${isSidebarCollapsed ? "collapsed" : ""}`}>
      <div
        className={`${
          isSidebarCollapsed ? "top-section-collapsed" : "top-section"
        }`}
      >
        <div className="logo-section">
          <img src={doctorlogo} alt="Logo" className="sidebar-logo" />
          <button onClick={toggleSidebar} className="toggle-button">
            <img
              src={isSidebarCollapsed ? RightArrow : LeftArrow}
              alt="Collapse Icon"
              className="arrow-icon"
            />
          </button>
        </div>
      </div>

      <ul className="options">
        <div
          className={`middle_sidebar ${isSidebarCollapsed ? "collapsed" : ""}`}
        >
          {filteredSidebarOptions.map((option, index) => (
            <li
              key={index}
              className={`option ${isSidebarCollapsed ? "collapsed" : ""} ${
                option.specialClass ? "special-class" : ""
              } w-full cursor-pointer`}
              onClick={() =>
                option.hasSubmenu
                  ? toggleSubmenu(index)
                  : handleNavigation(option.route)
              }
            >
              <div className="flex items-center justify-between">
                <div
                  className={`h-9 option-link flex items-center w-full body-N ${
                    isSidebarCollapsed ? "collapsed" : ""
                  } py-6`}
                >
                  <div className="flex items-center">
                    <img
                      src={option.icon}
                      alt="icon"
                      className="option-icon w-8 h-7"
                    />
                    {!isSidebarCollapsed && (
                      <p className="ml-4 body-N text-left sidebar-text">
                        {option.name}
                      </p>
                    )}
                  </div>
                  {option.hasSubmenu && (
                    <img
                      src={Sidearrow}
                      alt="arrow"
                      className={`arrow-icon ml-auto ${
                        expandedMenu === index ? "rotate-90" : ""
                      }`}
                    />
                  )}
                </div>
              </div>

              {!isSidebarCollapsed &&
                expandedMenu === index &&
                option.hasSubmenu && (
                  <ul className="submenu pl-12">
                    {option.submenu.map((subOption, subIndex) => (
                      <li
                        key={subIndex}
                        className="submenu-option mt-2 cursor-pointer"
                        onClick={() => handleNavigation(subOption.route)}
                      >
                        {subOption.name}
                      </li>
                    ))}
                  </ul>
                )}
            </li>
          ))}
        </div>
      </ul>
    </div>
  );
};

export default SidebarComponent;
